  false,\n\t\"url\": null,\n\t\"notes\": \"The site-specific agreement describes purpose
  and scope of the partnership between Ducks Unlimited, Inc. and U.S. Fish and Wildlife
  Service to manage wetlands for enhanced waterfowl habitat. It also details the execution,
  modification, and duration of the agreement. The agreement was made in accordance
  with the Memorandum of Understanding, dated March 14, 1984 between the U.S. Fish
  and Wildlife Service and Ducks Unlimited, Inc. This agreement is for a project to
  develop the Lake Mason Wetland to benefit migratory waterfowl and other natural
  resources.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
